create table autoservisy
(
    id        int auto_increment
        primary key,
    global_id varchar(255) null,
    nazev     varchar(255) null,
    mesto     varchar(255) null,
    ulice     varchar(255) null,
    psc       varchar(50)  null,
    logo      varchar(255) null,
    prodejAut int          null,
    servisAut int          null
)
    auto_increment = 226;

